select r.d_name as department, r.name as employee, r.salary 
from (select e.id, e.salary, e.name, d.name as d_name, max(e.salary) over (partition by e.departmentid) as max_sal 
from schema_184.employee as e join schema_184.department as d on d.id = e.departmentid) as r where r.salary = r.max_sal;

